                        else:
                            all_kpi_data = df[df['kpi_name'] == kpi_name]['value']

                        if len(all_kpi_data) == 0:
                            continue

                        # Calculate threshold
                        if anomaly_type == 'high':
                            threshold = all_kpi_data.quantile(quantile)
                        else:  # 'low'
                            threshold = all_kpi_data.quantile(quantile)

                        # Calculate metric during failure window
                        if metric_type == 'service':
                            kpi_summary = failure_data.groupby('service').agg({
