                            if len(kpi_failure_data) == 0:
                                continue
                            kpi_summary = kpi_failure_data.groupby('cmdb_id').agg({
                                'value': agg_func
                            }).reset_index()
                            group_col = 'cmdb_id'

                        # Identify anomalies
